キースマート2.0 エクステンデッド KEYSMART 2.0 EXTENDED キーホルダー たくさん鍵を持っている方、必見！！<br><br>
キースマートさえ持っていれば、簡単に複数の鍵を収納できます。<br><br>

特徴的なのはカギの収納方法。ジャラジャラさせて持ち歩くような一般的なキーホルダーとは異なり、専用のパーツとビスで複数のキーを束ねるスタイル。さらに、オプションパーツ追加することで、鍵の収納本数を調整可能です。<br><br>
こちらのベースモデルは鍵を10本まで収納可能！<br><br>
ほぼすべての鍵に適合します（※カギ穴直径4mm以上）<br><br></DIV>
